import React from "react";
import Car from "./Car"


function CarType() {
  const [campos, setCampos] = useState({
    car_type: '',
  })

}

function handleInputChange(event) {
  campos[event.target.name] = event.target.value;
  setCampos(campos);
}

function handleFormSubmit(event) {
  event.preventDefault();
  console.log(campos);
}

class CarList extends React.Component{
  render(){
    return(
      <div>
        <Form.Control as="select" name="car_type" size="lg" placeholder="" style={{ width: '400px' }} onChange={handleInputChange}>

        <select>
          <option selected disabled="true">Select the car type</option>
          {
            Car.CarType.map((result)=>(<option text={result.Id}>{result.Cname}</option>))
          }
        </select>
        </Form.Control>
      </div>
    );
  }
}


export default CarList;
